    const $animMask = $animWrapper.querySelector('.animMask');
    const $heroWidget = document.querySelector('.heroWidget');
    const $bannerColWrapper = document.querySelector('.bannerColWrapper');
    const $bannerTitle = $bannerColWrapper.querySelector('.bannerTitle');
    const $bannerButton = $bannerColWrapper.querySelector('.bannerButton');

    gsap.set([$bannerTitle, $bannerButton, $animWrapper, $heroWidget], {
      y: 100,
      opacity: 0
    });

    const params = {
      container: $animMask,
      renderer: 'svg',
      loop: true,
      autoplay: false,
      animationData: heroAnimArray
    };

    let animateMask = lottie.loadAnimation(params);

    let animHeroDuration = 1;
    let animHeroEase = 'power1.out';

    let tlHeroBanner = gsap.timeline({
      paused: false,
      defaults: {
        duration: animHeroDuration,
        ease: animHeroEase
      },
      delay: 1.3
    });

    let tlHeroWidjet = gsap.timeline({
      paused: true,
      repeat: -1,
      repeatDelay: 5,
      defaults: {
        duration: animHeroDuration,
        ease: animHeroEase
      }
    });

    tlHeroWidjet
      .addLabel('start')
      .add(maskPlay)
      .to($heroWidget, {
        y: 100,
        opacity: 0,
      }, 'start')
      .add(maskStop, '+=4')
      .to($heroWidget, {
        y: 0,
        opacity: 1
      }, 'start+=5')

    function maskPlay() {
      animateMask.play();
    }

    function maskStop() {
      animateMask.stop();
    }


    tlHeroBanner
      .addLabel('start')
      .to($bannerTitle, {
        y: 0,
        opacity: 1,
      }, 'start')
      .to($bannerButton, {
          y: 0,
          opacity: 1,
        }, 'start+=.4')
      .to($animWrapper, {
          y: 0,
          opacity: 1,
        },'start+=1')
      .add(maskPlay, 'start+=1.6')
      .add(maskStop, 'start+=7')
      .to($heroWidget, {
        y: 0,
        opacity: 1,
      }, 'start+=7')
      .add(function () {
        tlHeroWidjet.play();
      }, 'start+=13')

    ScrollTrigger.batch('.first-section', {
      onLeave: batch => {
        // console.log('onLeave slider');
        tlHeroWidjet.pause();
      },
      onEnterBack: batch => {
        // console.log('onEnterBack slider');
        tlHeroWidjet.play();
      },
    });

